const nodemailer = require('nodemailer');
const inlineBase64 = require('nodemailer-plugin-inline-base64');

// async..await is not allowed in global scope, must use a wrapper
async function main() {
  let transporter = nodemailer.createTransport({
    service: 'zoho',
    auth: {
      user: 'support@onsi.in', // generated ethereal user
      pass: 'Support@12345', // generated ethereal password
    },
  });

  const options = {
    cidPrefix: `auth_${Math.floor(Date.now())}`,
  };

  transporter.use('compile', inlineBase64(options));

  // send mail with defined transport object
  let info = await transporter.sendMail({
    from: '"Santosh mahto" <support@onsi.in>', // sender address
    to: 'tech@teckat.com, inonsinet@gmail.com', // list of receivers
    subject: 'Hello âœ”', // Subject line
    text: 'Hello world?', // plain text body
    html: `<b>Hello world?
          </b>
          <img src="data:image/png;base64,", alt="test">
          <h1 style="color: purple"> by ONSI</h1>
          `, // html body
  });

  console.log('Message sent: %s', info.messageId);
  // Message sent: <b658f8ca-6296-ccf4-8306-87d57a0b4321@example.com>
}

main()
  .then(console.info('success'))
  .finally(console.info('task completed'))
  .catch(console.error);
